import React from 'react';

class UsersOnline extends React.Component {

    render() {
        console.log(this.props.usersOnline);
        const usersOnlineStyle = {
            float: 'right',
            width: '400px',
            height: '600px',
            border: 'black 2px solid'
        };
        const usersOnline = this.props.usersOnline.map((user) => {
            return (
                <div>
                    {user}
                </div>
            )
        });
        return (
            <div style={usersOnlineStyle}>
                {usersOnline}
            </div>
        )
    }
}

export default UsersOnline;
